def sliding_moving_average(input, N, M):
    output = np.zeros(N)
    accumulator = 0.0
    aux = int((M - 1) / 2)

    # Para las primeras aux+1 muestras
    for i in range(M):
        accumulator += input[i]
        if i >= aux:
            output[i - aux] = accumulator / (i + 1)

    # Para el resto de las muestras (ventanas deslizantes completas)
    for i in range(M - aux, N - aux):
        accumulator += input[i + aux] - input[i - aux - 1]  # Actualiza el acumulador
        output[i] = accumulator / M  # Calcula el promedio

    # Para los últimos valores
    for i in range(N - aux, N):
        accumulator -= input[i - aux - 1]  # Restar el valor sobrante
        output[i] = accumulator / (N - i + aux)  # Promedio con los valores restantes

    return output

def obtain_breakdown_voltage(voltages, currents):
    # Ensure inputs are numpy arrays for efficient calculations
    # voltages = np.array(voltages)
    # currents = np.array(currents)
    
    # # Eliminate unstable current regions by filtering very low or zero currents
    # stable_indices = currents > 1e-12  # Avoid log of zero or negative currents
    # voltages = voltages[stable_indices]
    # currents = currents[stable_indices]
    
    # # Compute the natural logarithm of the current
    # ln_currents = np.log(currents)
    
    # # Calculate the derivative of ln(I) with respect to V using finite differences
    # dlnI_dV = np.gradient(ln_currents, voltages)
    
    # # Avoid division by zero in the inverse calculation by filtering near-zero derivatives
    # nonzero_indices = np.abs(dlnI_dV) > 1e-9
    # voltages = voltages[nonzero_indices]
    # dlnI_dV = dlnI_dV[nonzero_indices]
    
    # # Compute the inverse of the derivative: 1 / (dln(I)/dV)
    # inverse_derivative = 1 / dlnI_dV
    
    # # Find the voltage corresponding to the minimum value of 1 / (dln(I)/dV)
    # min_index = np.argmin(inverse_derivative)
    # vbd = voltages[min_index]
    
    # return vbd, inverse_derivative
    # VoffSet = 3.581
    # Calcular el logaritmo natural de la corriente
    log_currents = np.log(currents)
    
    # Inicializar derivadas
    deriv = np.zeros_like(voltages)
    
    # Calcular la derivada en los extremos
    deriv[0] = (log_currents[1] - log_currents[0]) / (voltages[1] - voltages[0])
    deriv[-1] = (log_currents[-1] - log_currents[-2]) / (voltages[-1] - voltages[-2])
    
    # Calcular derivadas centrales
    # derivative[i] = (logarithmicCurrent[i + 1] - logarithmicCurrent[i - 1]) / 
    #                     (inverseVoltage[i + 1] - inverseVoltage[i - 1]);
    for i in range(1, len(voltages) - 1):
        delta_voltage = voltages[i + 1] - voltages[i - 1]
        if delta_voltage != 0:
            deriv[i] = (log_currents[i + 1] - log_currents[i - 1]) / delta_voltage
        else:
            deriv[i] = np.inf  # Evita dividir por cero; usa un valor grande para marcarlo.

    # Manejar posibles divisiones por cero en la inversa de la derivada
    with np.errstate(divide='ignore', invalid='ignore'):  # Ignora errores de división
        inv_deriv = np.where(deriv > 0.0, 1 / deriv, np.nan)  # Se calcula si deriv > 0
        # asignamos nan cuando la corriente es cte en la curva
    
    # Encontrar el índice del pico ignorando valores NaN
    peak_index = np.nanargmin(inv_deriv)
    # Obtener el voltaje de ruptura correspondiente al pico
    breakdown_voltage = voltages[peak_index]
    
    return breakdown_voltage, inv_deriv

